import React from 'react'
import './styles.css'

function Bootstrap() {
  return (
    <div className='container'>
    <div className='row'>

      <div className='col-lg-4 col-md bgred'>
        <h1>Leftside</h1>
      </div>

      <div className='col-lg-4 bgYellow'>
        <h1>Center</h1>
      </div>

      <div className='col-lg-4 bgreen'>
        <h1>Rightside</h1>
      </div>

    </div>
    </div>
  );
}

export default Bootstrap;
